import React from 'react';
import { useNavigate } from 'react-router-dom';

const FAST_STEPS = [
  { id: 'face', label: 'Face (1/4)', path: '/test-facial' },
  { id: 'arm-right', label: 'Braço Direito (2/4)', path: '/test-arm-right' },
  { id: 'arm-left', label: 'Braço Esquerdo (3/4)', path: '/test-arm-left' },
  { id: 'speech', label: 'Fala (4/4)', path: '/test-speech' }
];

export default function FastNav({ currentTest }) {
  const navigate = useNavigate();

  return (
    <div className="fast-nav card">
      <p className="eyebrow mb-2">Testes FAST</p>
      <div className="fast-nav__grid">
        {FAST_STEPS.map(step => (
          <button
            key={step.id}
            className={`fast-nav__button ${currentTest === step.id ? 'active' : ''}`}
            type="button"
            onClick={() => {
              if (currentTest !== step.id) {
                navigate(step.path);
              }
            }}
            disabled={currentTest === step.id}
          >
            {step.label}
          </button>
        ))}
      </div>
    </div>
  );
}
